    const expenseTitle='Title';
    const expensePrice='56$';
    return(
    // <h1>ExpenseItem</h1>
    <div className="expense-item">
        <div> {props.date}</div>
        <div className="expense-item__description">
            <h2>{props.name}</h2>
            <div className="expense-item__price">{expensePrice}</div>
        </div>

    </div>
)
}
export default expenseitem
